import { login } from "../saga/authSaga"
import { AUTH_FETCH_LOGIN } from "../type";
import { takeLatest } from 'redux-saga/effects'

export default function* mySaga() {
    yield takeLatest(AUTH_FETCH_LOGIN, login)
}
